Step 1. Reasoning

• Key Psychological Mechanisms: Responders assess fairness in the proposal by comparing the offered split with what they perceive as an equitable division. The perceived fairness is determined by comparing the proposed amount (split_self) with the fair share given by the tokens earned relative to the opponent (token_self vs. token_opp). A proposal giving less than the fair share is less likely to be accepted.

• Mechanism Interactions: The responder’s decision arises from integrating a baseline acceptance tendency (intercept) with a sensitivity to deviations from fair division. A positive difference between offered and fair share increases acceptance likelihood, while a negative difference decreases it.

• Mathematical Form: The model is a logistic choice model. The latent utility (U) is given by a linear combination of an intercept and the fairness difference. The fairness difference is computed as the difference between the actual offered share and the fair share computed by proportionally dividing the combined earning according to token contributions.

• Needed Parameters: 
  – An intercept (beta0) representing baseline utility.
  – A fairness sensitivity parameter (beta_fair) scaling the fairness difference.
Both parameters are learnable and will have finite, generously wide bounds.

• Mapping to Observable Behavior: The computed utility U is converted into a choice probability using a logistic function. Proposals with U > 0 yield probabilities over 50% (and vice versa) – aligning with the idea that utility less than 0 corresponds to a less-than-50% chance of acceptance.

Final Formal Model and Variable Descriptions (with all learnable parameters having finite numerical bounds):

